(function(){"use strict";var n;n=angular.module("pandorabox.pages"),n.register.controller("AboutController",["$scope","$UCI",function(n,o){n.firmware=["PandoraBox路由器系统是基于OpenWrt二次开发的路由器系统，\n它的目标在于为智能设备厂商和开发者提供具有高可靠性和稳定性的完整解决方案。","全新的网页框架和丰富的插件支持是这款系统的特性，\n简单易用的引导系统能使你的设备轻松地享有与以往不一样的操控体验，\n尤其适合智能路由器。","相比原版的OpenWrt系统，PandoraBox有以下特性:","1.简单易用的操作页面和OpenWrt原生的管理界面","2.经过测试的闭源厂商驱动，解决OpenWrt最大的缺陷","3.实时linux内核, 增强保证系统的稳定性以及响应速度","4.独有的NAS应用加速，提升50%的文件传输性能","5.完善OpenWrt驱动API层兼容","6.Codec/VoIP/VoiceDSP互联网通信套件支持","7.智能网络带宽控制支持"],n.team=["PandoraBox团队是由开源DreamBox项目组成员lintel创立，专注于提供消费类网络设备的系统解决方案。","目前团队规模为15位左右，主要集中于OpenWrt相关研发，如BSP软件硬件支持，Linux网络增强，DPI引擎等。","商务合作:","ray@xcloud.cc","D-Team Technology Co.,Ltd. ShenZhen(PandoraBox Team)","地址：深圳市南山区科技园南区高新南四道W1-A幢6层612"]}])}).call(this);